import ExpenseItem from './components/ExpenseItem'
function App() {
  const expenses = [
    {
      expenseDate: new Date(2021, 2, 28),
      expenseTitle: 'Car Insurance',
      expenseAmount: 122
    },
    {
      expenseDate: new Date(2021, 4, 2),
      expenseTitle: 'Health Checkup',
      expenseAmount: 200
    },
    {
      expenseDate: new Date(2022, 9, 10),
      expenseTitle: 'Furniture',
      expenseAmount: 1000
    },
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem>
        expenseDate = {expenses[0].expenseDate.toISOString()}
        expenseTitle = {expenses[0].expenseTitle}
        expenseAmount = {expenses[0].expenseAmount}
      </ExpenseItem>
      <ExpenseItem>
        expenseDate = {expenses[1].expenseDate.toISOString()}
        expenseTitle = {expenses[1].expenseTitle}
        expenseAmount = {expenses[1].expenseAmount}
      </ExpenseItem><ExpenseItem>
        expenseDate = {expenses[2].expenseDate.toISOString()}
        expenseTitle = {expenses[2].expenseTitle}
        expenseAmount = {expenses[2].expenseAmount}
      </ExpenseItem>
    </div>
  );
}

export default App;
